const axios = require('axios')

const createCoffeeShop = (coffeeShopData, setCoffeeShop) => {

    axios.post('/coffee_shops', {
        "name": coffeeShopData.name,
        "house_roasted": false,
        "roaster_name": null
    }).then( res => setCoffeeShop(res) )
}

module.exports = { createCoffeeShop }
